    GiantDescriptionNames["Skymir"] = "\u041F\u043B\u0435\u043D\u0438\u0442\u0435 \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0443\u044E \u043A\u0430\u0440\u0442\u0443 \u043E\u0445\u043E\u0442\u043D\u0438\u043A\u0430, \u043A\u043E\u0442\u043E\u0440\u0443\u044E \u0432\u044B \u043F\u0440\u0438\u0437\u043E\u0432\u0451\u0442\u0435. \u0417\u0430\u0442\u0435\u043C \u0432\u043E\u0437\u044C\u043C\u0438\u0442\u0435 5 \u043A\u0430\u0440\u0442 \u0438\u0437 \u0440\u0435\u0437\u0435\u0440\u0432\u0430 \u043B\u0435\u0433\u0435\u043D\u0434 \u0440\u044F\u0434\u043E\u043C \u0441 \u043A\u043E\u0440\u043E\u043B\u0435\u0432\u0441\u043A\u043E\u0439 \u0441\u043E\u043A\u0440\u043E\u0432\u0438\u0449\u043D\u0438\u0446\u0435\u0439 \u0438 \u0432\u044B\u0431\u0435\u0440\u0438\u0442\u0435 \u0441\u0435\u0431\u0435 2. \u041E\u0441\u0442\u0430\u0432\u0448\u0438\u0435\u0441\u044F \u043A\u0430\u0440\u0442\u044B \u043F\u043E\u043B\u043E\u0436\u0438\u0442\u0435 \u043F\u043E\u0434 \u043D\u0438\u0437 \u0441\u0442\u043E\u043F\u043A\u0438 \u0440\u0435\u0437\u0435\u0440\u0432\u0430 \u043B\u0435\u0433\u0435\u043D\u0434.";
