    ArtefactDescriptionNames["Megingjord"] = "\u0421 \u043C\u043E\u043C\u0435\u043D\u0442\u0430 \u043F\u043E\u043B\u0443\u0447\u0435\u043D\u0438\u044F \u044D\u0442\u043E\u0433\u043E \u0430\u0440\u0442\u0435\u0444\u0430\u043A\u0442\u0430 \u0438 \u0434\u043E \u043A\u043E\u043D\u0446\u0430 \u0438\u0433\u0440\u044B \u0432\u043B\u0430\u0434\u0435\u043B\u0435\u0446 \u043D\u0435 \u043C\u043E\u0436\u0435\u0442 \u043F\u0440\u0438\u0437\u044B\u0432\u0430\u0442\u044C \u0433\u0435\u0440\u043E\u0435\u0432 \u0432 \u0441\u0432\u043E\u044E \u0430\u0440\u043C\u0438\u044E \u043F\u043E\u0441\u043B\u0435 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043B\u0438\u043D\u0438\u0438 5 \u0448\u0435\u0432\u0440\u043E\u043D\u043E\u0432. \u0412\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0434\u0441\u0447\u0451\u0442\u0430 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432 \u0432 \u043A\u043E\u043D\u0446\u0435 \u044D\u043F\u043E\u0445\u0438 2 \u043F\u0440\u0438\u0431\u0430\u0432\u044C\u0442\u0435 \u043A \u0441\u0432\u043E\u0435\u043C\u0443 \u0438\u0442\u043E\u0433\u043E\u0432\u043E\u043C\u0443 \u043F\u043E\u043A\u0430\u0437\u0430\u0442\u0435\u043B\u044E \u0445\u0440\u0430\u0431\u0440\u043E\u0441\u0442\u0438 28 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432. \u0413\u044C\u044F\u043B\u043B\u0430\u0440\u0445\u043E\u0440\u043D \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u0435\u0442 \u0438\u0433\u0440\u043E\u043A\u0443 \u043F\u0440\u0438\u0437\u044B\u0432\u0430\u0442\u044C \u0433\u0435\u0440\u043E\u0435\u0432, \u0434\u0430\u0436\u0435 \u0435\u0441\u043B\u0438 \u043E\u043D \u0432\u043B\u0430\u0434\u0435\u0435\u0442 \u041C\u0435\u0433\u0438\u043D\u0433\u044C\u043E\u0440\u0434\u043E\u043C.";
    ArtefactDescriptionNames["Mjollnir"] = "\u0412\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0434\u0441\u0447\u0451\u0442\u0430 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432 \u0432 \u043A\u043E\u043D\u0446\u0435 \u044D\u043F\u043E\u0445\u0438 2 \u043F\u0440\u0438\u0431\u0430\u0432\u044C\u0442\u0435 \u043A \u0441\u0432\u043E\u0435\u043C\u0443 \u0438\u0442\u043E\u0433\u043E\u0432\u043E\u043C\u0443 \u043F\u043E\u043A\u0430\u0437\u0430\u0442\u0435\u043B\u044E \u0445\u0440\u0430\u0431\u0440\u043E\u0441\u0442\u0438 2 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u0430 \u0437\u0430 \u043A\u0430\u0436\u0434\u044B\u0439 \u0448\u0435\u0432\u0440\u043E\u043D \u0432 \u043A\u043E\u043B\u043E\u043D\u043A\u0435 \u043E\u0434\u043D\u043E\u0433\u043E \u0432\u043E\u0438\u043D\u0441\u043A\u043E\u0433\u043E \u043A\u043B\u0430\u0441\u0441\u0430 \u043F\u043E \u0432\u044B\u0431\u043E\u0440\u0443 \u0438\u0433\u0440\u043E\u043A\u0430.";
    ArtefactDescriptionNames["Odroerir_The_Mythic_Cauldron"] = "\u0412\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0434\u0433\u043E\u0442\u043E\u0432\u043A\u0438 \u043E\u0442\u043B\u043E\u0436\u0438\u0442\u0435 \u041E\u0434\u0440\u0435\u0440\u0438\u0440 \u0432 \u0441\u0442\u043E\u0440\u043E\u043D\u0443. \u041F\u0435\u0440\u0435\u043C\u0435\u0448\u0430\u0439\u0442\u0435 \u043A\u0430\u0440\u0442\u044B \u041B\u0430\u0433\u0435\u0440\u044F 2-\u0439 \u044D\u043F\u043E\u0445\u0438, \u0437\u0430\u0442\u0435\u043C \u043F\u043E\u043B\u043E\u0436\u0438\u0442\u0435 \u041E\u0434\u0440\u0435\u0440\u0438\u0440 \u043D\u0430 \u0432\u0435\u0440\u0445 \u043A\u043E\u043B\u043E\u0434\u044B. \u0422\u0430\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C, \u0432 \u043D\u0430\u0447\u0430\u043B\u0435 \u042D\u043F\u043E\u0445\u0438 2 \u041E\u0434\u0440\u0435\u0440\u0438\u0440 \u0431\u0443\u0434\u0435\u0442 \u0441\u0440\u0435\u0434\u0438 5 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0445 \u043A\u0430\u0440\u0442 \u043B\u0430\u0433\u0435\u0440\u044F. \u041A\u0430\u043A \u0442\u043E\u043B\u044C\u043A\u043E \u044D\u043B\u044C\u0432\u0435\u043B\u0430\u043D\u0434 \u0431\u0435\u0440\u0435\u0442 \u043A\u0430\u0440\u0442\u0443 \u0438\u0437 \u043B\u0430\u0433\u0435\u0440\u044F, \u043F\u043E\u043B\u043E\u0436\u0438\u0442\u0435 \u0441\u0430\u043C\u0443\u044E \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u0443\u044E \u043C\u043E\u043D\u0435\u0442\u0443 \u0438\u0437 \u041A\u043E\u0440\u043E\u043B\u0435\u0432\u0441\u043A\u043E\u0439 \u0441\u043E\u043A\u0440\u043E\u0432\u0438\u0449\u043D\u0438\u0446\u044B \u043D\u0430 \u041E\u0434\u0440\u0435\u0440\u0438\u0440. \u0414\u0435\u043B\u0430\u0439\u0442\u0435 \u044D\u0442\u043E \u0434\u043E \u0442\u0435\u0445 \u043F\u043E\u0440, \u043F\u043E\u043A\u0430 \u044D\u043B\u044C\u0432\u0435\u043B\u0430\u043D\u0434 \u043D\u0435 \u0432\u043E\u0437\u044C\u043C\u0435\u0442 \u043A\u0430\u0440\u0442\u0443 \u041E\u0434\u0440\u0435\u0440\u0438\u0440 \u0441 \u043C\u043E\u043D\u0435\u0442\u0430\u043C\u0438 \u043D\u0430 \u043D\u0435\u0439. \u041A\u0430\u0440\u0442\u0430 \u041E\u0434\u0440\u0435\u0440\u0438\u0440 \u0441 \u0435\u0435 \u043C\u043E\u043D\u0435\u0442\u0430\u043C\u0438 \u043D\u0430\u0445\u043E\u0434\u0438\u0442\u0441\u044F \u0432 \u043A\u043E\u043C\u0430\u043D\u0434\u043D\u043E\u0439 \u0437\u043E\u043D\u0435. \u0412 \u043A\u043E\u043D\u0446\u0435 \u0438\u0433\u0440\u044B \u041E\u0434\u0440\u0435\u0440\u0438\u0440 \u043F\u0440\u0438\u0431\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u0443\u043C\u043C\u0443 \u0432\u0441\u0435\u0445 \u043C\u043E\u043D\u0435\u0442 \u043A \u0432\u0430\u0448\u0435\u043C\u0443 \u0438\u0442\u043E\u0433\u043E\u0432\u043E\u043C\u0443 \u0437\u043D\u0430\u0447\u0435\u043D\u0438\u044E \u0445\u0440\u0430\u0431\u0440\u043E\u0441\u0442\u0438.";
    ArtefactDescriptionNames["Svalinn"] = "\u0412\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u0434\u0441\u0447\u0451\u0442\u0430 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432 \u0432 \u043A\u043E\u043D\u0446\u0435 \u044D\u043F\u043E\u0445\u0438 2 \u043F\u0440\u0438\u0431\u0430\u0432\u044C\u0442\u0435 \u043A \u0441\u0432\u043E\u0435\u043C\u0443 \u0438\u0442\u043E\u0433\u043E\u0432\u043E\u043C\u0443 \u043F\u043E\u043A\u0430\u0437\u0430\u0442\u0435\u043B\u044E \u0445\u0440\u0430\u0431\u0440\u043E\u0441\u0442\u0438 5 \u043F\u043E\u0431\u0435\u0434\u043D\u044B\u0445 \u043E\u0447\u043A\u043E\u0432 \u0437\u0430 \u043A\u0430\u0436\u0434\u0443\u044E \u0441\u0432\u043E\u044E \u043A\u0430\u0440\u0442\u0443 \u0433\u0435\u0440\u043E\u044F.";
