    ArtefactDescriptionNames["Vidofnir_Vedrfolnir"] = "\u0412\u0437\u044F\u0432 \u044D\u0442\u043E\u0442 \u0430\u0440\u0442\u0435\u0444\u0430\u043A\u0442, \u0441\u0440\u0430\u0437\u0443 \u0436\u0435 \u043E\u0442\u043A\u0440\u043E\u0439\u0442\u0435 \u043C\u043E\u043D\u0435\u0442\u044B \u0432 \u0432\u0430\u0448\u0435\u043C \u043A\u043E\u0448\u0435\u043B\u0435 \u0438 \u0443\u043B\u0443\u0447\u0448\u0438\u0442\u0435 \u043D\u0430 +2 \u043E\u0434\u043D\u0443 \u0438\u0437 \u043D\u0438\u0445 \u0438 \u043D\u0430 +3 \u0434\u0440\u0443\u0433\u0443\u044E. \u0423\u043B\u0443\u0447\u0448\u0435\u043D\u0438\u0435 \u043C\u043E\u043D\u0435\u0442 \u043C\u043E\u0436\u043D\u043E \u043F\u0440\u043E\u0438\u0437\u0432\u043E\u0434\u0438\u0442\u044C \u0432 \u043B\u044E\u0431\u043E\u0439 \u043E\u0447\u0435\u0440\u0451\u0434\u043D\u043E\u0441\u0442\u0438. \u0415\u0441\u043B\u0438 \u043E\u0434\u043D\u0430 \u0438\u0437 \u043C\u043E\u043D\u0435\u0442 \u0432 \u043A\u043E\u0448\u0435\u043B\u0435 \u043E\u0431\u043C\u0435\u043D\u043D\u0430\u044F (0 \u0438\u043B\u0438 \u043E\u0441\u043E\u0431\u0430\u044F \u043E\u0431\u043C\u0435\u043D\u043D\u0430\u044F \u043C\u043E\u043D\u0435\u0442\u0430 \u041E\u0445\u043E\u0442\u043D\u0438\u043A\u043E\u0432 \u0441 \u043D\u043E\u043C\u0438\u043D\u0430\u043B\u043E\u043C 3), \u0442\u043E\u0433\u0434\u0430 \u0443\u043B\u0443\u0447\u0448\u0438\u0442\u0435 \u043D\u0430 +5 \u0432\u0442\u043E\u0440\u0443\u044E \u043C\u043E\u043D\u0435\u0442\u0443 \u0432 \u043A\u043E\u0448\u0435\u043B\u0435.";
